import React, { useEffect, useState } from "react";

function CoinCourse() {
  const [answer, setAnwser] = React.useState([]);

    useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/todos?_limit=2")
        .then(response => response.json())
        .then(answer => setAnwser(answer))
    }, []);
    console.log(answer.map(item=>item.length));
    return (<div>{JSON.stringify(answer)}</div>);
}
export default CoinCourse;

